export const colors = {
  accent: "#20C8AF",
  headings: "#0E204D",
  text: "#848E9F",
  cta: "#7934C7",
};

export const fonts = {
  headings: "'Poppins', sans-serif",
  text: "'Rubik', sans-serif",
};

export const breakpoints = {
  desktop: "1025px",
  tabletWide: "1024px",
  tablet: "768px",
};

export const devices = {
  desktop: `(min-width: ${breakpoints.desktop})`,
  tabletWide: `(max-width: ${breakpoints.tabletWide})`,
  tablet: `(max-width: ${breakpoints.tablet})`,
};
